import React from "react";
import {logo} from "../data/user";
import "./nav.css";


function Nav(){
    return(
        <div className="">
        <div class="mshamba">
            <img src={logo} alt=""/>
            <h3>Mshamba</h3>
        </div>
        <div class="links">
            <a href="#home">Home</a>
            <a href="#about">About</a>
            <a href="#contacts">Contacts</a>
            <a href="#mshamba">Mshamba</a>       
        </div>
    </div>
    );
}

export default Nav;
